import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <ul>
        <li>L</li>
        <li>E</li>
        <li>V</li>
      </ul>
      <App2/>
    </div>
  );
}
function App2() {
  return (
    <div className="App">
      <ul>
        <li>H</li>
        <li>A</li>
        <li>R</li>
      </ul>
    </div>
  );
}


export default App;
